import React, { useEffect, useRef, useState } from "react";
import { motion } from "framer-motion";
import {
  BrainIcon,
  ZapIcon,
  TargetIcon,
  TrendingUpIcon,
} from "lucide-react";

export default function AboutSection() {
  const [inView, setInView] = useState(false);
  const ref = useRef(null);

  useEffect(() => {
    const observer = new IntersectionObserver(
      ([entry]) => {
        if (entry.isIntersecting) {
          setInView(true);
        }
      },
      { threshold: 0.2 }
    );

    if (ref.current) {
      observer.observe(ref.current);
    }

    return () => {
      if (ref.current) {
        observer.unobserve(ref.current);
      }
    };
  }, []);

  const highlights = [
    {
      icon: BrainIcon,
      title: "Análisis de Datos",
      description: "Python, R, SQL y Excel avanzado",
    },
    {
      icon: ZapIcon,
      title: "Automatización IA",
      description: "GPT agents, N8N y Power Automate",
    },
    {
      icon: TargetIcon,
      title: "Lead Generation",
      description: "HubSpot, Sales Navigator, Apollo",
    },
    {
      icon: TrendingUpIcon,
      title: "Visualización",
      description: "Pandas, Matplotlib, Plotly",
    },
  ];

  return (
    <section id="about" className="py-24 bg-white">
      <div className="max-w-7xl mx-auto px-6">
        <motion.div
          ref={ref}
          initial={{ opacity: 0, y: 30 }}
          animate={inView ? { opacity: 1, y: 0 } : {}}
          transition={{ duration: 0.8 }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl md:text-5xl font-bold text-[#222222] mb-4">
            Sobre <span className="gradient-text">Mí</span>
          </h2>
          <div className="w-20 h-1 bg-gradient-to-r from-[#007BFF] to-[#00C896] mx-auto rounded-full" />
        </motion.div>

        <div className="grid md:grid-cols-2 gap-12 items-center">
          <motion.div
            initial={{ opacity: 0, x: -50 }}
            animate={inView ? { opacity: 1, x: 0 } : {}}
            transition={{ duration: 0.8, delay: 0.2 }}
          >
            <p className="text-lg text-gray-700 leading-relaxed mb-6">
              Soy profesional en <strong>Administración de Empresas</strong>, con
              especialización en <strong>Análisis y Ciencia de Datos</strong>,
              apasionado por transformar la información en decisiones estratégicas y
              automatizaciones inteligentes.
            </p>
            <p className="text-lg text-gray-700 leading-relaxed mb-6">
              Con experiencia técnica en <strong>Python, R, SQL</strong> y Excel avanzado,
              aplico librerías como Pandas, Matplotlib, scikit-learn y Plotly para
              análisis, visualización y gestión de bases de datos.
            </p>
            <p className="text-lg text-gray-700 leading-relaxed">
              Mi compromiso con el aprendizaje continuo y una mentalidad analítica me
              permiten aplicar nuevas tecnologías que impulsan la{" "}
              <strong className="gradient-text">eficiencia</strong>,{" "}
              <strong className="gradient-text">innovación</strong> y toma de decisiones
              basada en datos.
            </p>
          </motion.div>

          <motion.div
            initial={{ opacity: 0, x: 50 }}
            animate={inView ? { opacity: 1, x: 0 } : {}}
            transition={{ duration: 0.8, delay: 0.4 }}
            className="grid grid-cols-2 gap-4"
          >
            {highlights.map((item, index) => (
              <motion.div
                key={index}
                initial={{ opacity: 0, y: 20 }}
                animate={inView ? { opacity: 1, y: 0 } : {}}
                transition={{ duration: 0.5, delay: 0.6 + index * 0.1 }}
                className="p-6 bg-gradient-to-br from-blue-50 to-emerald-50 rounded-2xl hover:shadow-xl transition-all hover:-translate-y-2 group"
              >
                <item.icon className="w-8 h-8 text-[#007BFF] mb-3 group-hover:scale-110 transition-transform" />
                <h3 className="font-bold text-[#222222] mb-2">{item.title}</h3>
                <p className="text-sm text-gray-600">{item.description}</p>
              </motion.div>
            ))}
          </motion.div>
        </div>
      </div>
    </section>
  );
}
